  </div>
}
const WomensPage=(props)=>{
  console.log(props);

  return <div>
    <h1>Womens Page</h1>
  </div>
}
const MensPage=(props)=>{
  console.log(props);

  return <div>
    <h1>Mens Page</h1>
  </div>
}

function App() {
  return (
    <div className="App">
      <Route exact path='/' component={HomePage} />
    </div>
  );
}

export default App;
